import React, { useState } from 'react';
import { Nav, NavItem } from 'reactstrap';

const Navigation = () => {
  const [currentTab, setCurrentTab] = useState('home');

  const handleTabChange = (e, tab) => {
    e.preventDefault();
    setCurrentTab(tab);
  }

  return (
    <Nav tabs>
      <NavItem>
        <button onClick={e => handleTabChange(e, 'home')} className={currentTab === 'home' ? 'active' : ''}>Home</button>
      </NavItem>
      <NavItem>
        <button onClick={e => handleTabChange(e, 'about')} className={currentTab === 'about' ? 'active' : ''}>About</button>
      </NavItem>
      <NavItem>
        <button onClick={e => handleTabChange(e, 'services')} className={currentTab === 'services' ? 'active' : ''}>Services</button>
      </NavItem>
      <NavItem>
        <button onClick={e => handleTabChange(e, 'contact')} className={currentTab === 'contact' ? 'active' : ''}>Contact</button>
      </NavItem>
      <NavItem>
        <button onClick={e => handleTabChange(e, 'help')} className={currentTab === 'help' ? 'active' : ''}>Help</button>
      </NavItem>
    </Nav>
  );
}

export default Navigation;
